        /// <summary>
        /// 模式切換
        /// </summary>
        /// <returns></returns>
        public EntityAML_HQ_Work toShowMode()
        {
            EntityAML_HQ_Work returnObj = new EntityAML_HQ_Work();
            DataTableConvertor.Clone2Other<EntityAML_HQ_Work_edit, EntityAML_HQ_Work>(this, ref returnObj);
            foreach (EntityAML_HQ_Manager_Work_edit mangObj in _ManagerColl)
            {
                returnObj.ManagerColl.Add(mangObj.toShowMode());
            }
            return returnObj;
        }
